import React, { useState } from 'react'
import Map from './Map'

const Main = () => {

    const [range, setRange] = useState(0);

    const shipPositions = [
        {positionX: 51.505, positionY: -0.09},
        {positionX: 52.505, positionY: -0.09},
        {positionX: 51.700, positionY: -0.09},
        {positionX: 50.505, positionY: -0.09},
    ]
    const handleRange = (e) => {
        setRange(e.target.value)
    }
    return(
        <div className="row">
            <div className="col-md-9">
                <Map shipPositions={shipPositions} range={range}></Map>
            </div>
            <div className="col-md-3">
                        <form className="row g-3">
                            <div className="col-md-9">
                                <label for="range">Wprowadź zasięg rakiety</label>
                                <input type="number" id="range" onChange={handleRange}></input>
                            </div>  
                        </form>
            </div>
        </div>
    )
}

export default Main;
